class Solution:
    # @param A, a list of integers
    # @return an integer
    def maxProduct(self, A):
        
        f = [[(0,0) for j in xrange(len(A))] for i in xrange(len(A))]

        for i in xrange(len(A)):
            f[i][i] = (A[i], A[i])
        
        for i in xrange(len(A)-1, -1, -1):
            for j in xrange(i+1, len(A)):
                v2 = f[i][j-1][1]*A[j]
                v1 = max( f[i+1][j][0], f[i][j-1][0], A[j], v2)
                f[i][j] = (v1, v2)
            #for x in f:
            #    print x
            #print

        return f[0][-1][0]
            
